use dep::aztec::macros::aztec;

#[aztec]
pub contract AztlanProfileV3 {
    use dep::aztec::macros::{functions::{public}, storage::storage};
    use dep::aztec::prelude::{AztecAddress, Map, PublicMutable};

    #[storage]
    struct Storage<Context> {
        // Ganti PublicImmutable dengan PublicMutable untuk owner
        owner: PublicMutable<AztecAddress, Context>,
        username_hash_to_address: Map<Field, PublicMutable<AztecAddress, Context>, Context>,
        address_has_minted: Map<AztecAddress, PublicMutable<bool, Context>, Context>,
        profile_token_id: Map<AztecAddress, PublicMutable<Field, Context>, Context>,
        profile_username_hash: Map<AztecAddress, PublicMutable<Field, Context>, Context>,
        profile_metadata_uri: Map<AztecAddress, PublicMutable<Field, Context>, Context>,
        total_supply: PublicMutable<Field, Context>,
        next_token_id: PublicMutable<Field, Context>,
    }

    #[public]
    fn constructor(owner: AztecAddress) {
        // Initialize owner as first action
        let current_owner = storage.owner.read();
        assert(current_owner == AztecAddress::zero(), "Already initialized");
        storage.owner.write(owner);

        storage.total_supply.write(0);
        storage.next_token_id.write(1);
    }

    #[public]
    fn mint_profile_public(username_hash: Field, metadata_uri: Field) {
        let caller = context.msg_sender();

        // Cek apakah address sudah punya profile
        let has_minted = storage.address_has_minted.at(caller).read();
        assert(!has_minted, "Address already has a profile");

        // Cek apakah username sudah diambil
        let existing_owner = storage.username_hash_to_address.at(username_hash).read();
        assert(existing_owner == AztecAddress::zero(), "Username already taken");

        // Ambil token ID berikutnya
        let token_id = storage.next_token_id.read();

        // Set semua data profile
        storage.username_hash_to_address.at(username_hash).write(caller);
        storage.address_has_minted.at(caller).write(true);
        storage.profile_token_id.at(caller).write(token_id);
        storage.profile_username_hash.at(caller).write(username_hash);
        storage.profile_metadata_uri.at(caller).write(metadata_uri);

        // Update counters
        let current_supply = storage.total_supply.read();
        storage.total_supply.write(current_supply + 1);
        storage.next_token_id.write(token_id + 1);
    }

    // Pisahkan getter functions untuk menghindari complex return types
    #[public]
    fn has_profile(user: AztecAddress) -> bool {
        storage.address_has_minted.at(user).read()
    }

    #[public]
    fn get_profile_token_id(user: AztecAddress) -> Field {
        storage.profile_token_id.at(user).read()
    }

    #[public]
    fn get_profile_username_hash(user: AztecAddress) -> Field {
        storage.profile_username_hash.at(user).read()
    }

    #[public]
    fn get_profile_metadata_uri(user: AztecAddress) -> Field {
        storage.profile_metadata_uri.at(user).read()
    }

    #[public]
    fn get_address_by_username_hash(username_hash: Field) -> AztecAddress {
        storage.username_hash_to_address.at(username_hash).read()
    }

    #[public]
    fn get_owner() -> AztecAddress {
        storage.owner.read()
    }

    #[public]
    fn get_total_supply() -> Field {
        storage.total_supply.read()
    }
}

